import pic from'../images/award 1.png';
import AwardCard from "./AwardCard";
import { Navigation, Pagination, Scrollbar, A11y } from 'swiper';

import { Swiper, SwiperSlide } from 'swiper/react';

// Import Swiper styles
import 'swiper/css';
import 'swiper/css/navigation';
import 'swiper/css/pagination';
import 'swiper/css/scrollbar';

let card1={

    date:"2010",
    imgsrc:pic,
    para:"Won the Chancellors scholarship of University of Science and Technology Beijing and availed till the completion of doctoral degree."


    };
    let card2={
        date:"2006",
        imgsrc:pic,
    para:"Gold medal from KIU Gilgit Pakistan in recognition of getting first class first position in order of merit in all the existing departments of University during Masters Degree program."    

    };
    let card3={

        date:"2013",
        imgsrc:pic,
    para:"Awarded Certificate of excellence from University of Science and Technology Beijing."    

    };
    let card4={
        date:"2016",
        imgsrc:pic,
    para:"Ranked 29th among 122 young productive scientists of Pakistan in the field of engineering applications, ranking released by Pakistan Council for Science and Technology."    

    };
    let card5={
        date:"2017",
        imgsrc:pic,
    para:"Ranked 51st among 260 young productive scientists of Pakistan in the field of engineering applications, ranking released by Pakistan Council for Science and Technology."    

    }
let card6={
    date:"2019",
    imgsrc:pic,
para:"Received international award 2nd prize in Natural Sciences from Chinese Society for Stereology and Image Analysis, Ministry of Science and Technology China."    

};

let card7={
    date:"2020",
    imgsrc:pic,
para:"Received international award 2021 TMS Light Metals and Extraction & Processing Divisions Energy BEST PAPER AWARD from TMS, USA."    

};

function Awards() {
    return (<>

        <div className="container-fluid Award">
        <div className="container">
        <h1 className="text-center heading mt-5 text-light">Experience</h1>
        <Swiper 
          // install Swiper modules
          modules={[Navigation, Pagination, Scrollbar, A11y]}
          spaceBetween={10}
          slidesPerView={1}
          navigation


          onSwiper={(swiper) => console.log(swiper)}
          onSlideChange={() => console.log('slide change')}
        >


        <SwiperSlide><AwardCard date={card1.date} imgsrc={card1.imgsrc} para={card1.para} /> </SwiperSlide>

        <SwiperSlide><AwardCard date={card2.date} imgsrc={card2.imgsrc} para={card2.para} /> </SwiperSlide>

        <SwiperSlide><AwardCard date={card3.date} imgsrc={card3.imgsrc} para={card3.para} /> </SwiperSlide>
        <SwiperSlide><AwardCard date={card4.date} imgsrc={card4.imgsrc} para={card4.para} /> </SwiperSlide>
        <SwiperSlide><AwardCard date={card5.date} imgsrc={card5.imgsrc} para={card5.para} /> </SwiperSlide>
        <SwiperSlide><AwardCard date={card6.date} imgsrc={card6.imgsrc} para={card6.para} /> </SwiperSlide>
        <SwiperSlide><AwardCard date={card7.date} imgsrc={card7.imgsrc} para={card7.para} /> </SwiperSlide>



        </Swiper>
        </div>

        </div>

    </>);
}

export default Awards;
